import React from 'react';
import { navStyle } from '../navStyle';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
//import ButtonToolbar from 'react-bootstrap/ButtonToolbar';

class Navigation extends React.Component {
  constructor (props) {
    super(props);
    this.state = ({hover: false, buttonColor: 'white', border: '2px solid #FD9D2E', backgroundColor: 'transparent'})
  }

  componentDidMount () {
     console.log('component did mount')
  }

  onHover = (event) => {
    event.preventDefault();
    this.setState({hover: true, buttonColor: 'white', border: '2px solid #FD9D2E', backgroundColor: '#FD9D2E'});
    console.log(this.state.backgroundColor);
  }

  onLeave = (event) => {
    event.preventDefault();
    this.setState({hover: false, buttonColor: '#FD9D2E', border: '2px solid #FD9D2E', backgroundColor: 'transparent'});
    console.log(this.state.buttonColor);
  }


  render() {

    let { color, backgroundColor, brand, justifyContent, marginLeft, marginRight } = navStyle;


    return (
        <Navbar style={{backgroundColor, justifyContent}} expand="lg">
            <Navbar.Brand style={brand} href="#home" className="">Personal Capital</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
              <Nav fill variant="pills">
                <Nav.Item>
                  <Nav.Link style={{color}} href="/home">Financial Tools</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link style={{color}}>Wealth Management</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link style={{color}}>About</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link style={{color}}>Resources</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Button onMouseEnter={this.onHover} onMouseLeave={this.onLeave} style={{marginLeft: marginLeft, marginRight: marginRight, border: this.state.border, color: this.state.buttonColor, backgroundColor: this.state.backgroundColor }}>Login</Button>
                </Nav.Item>
                <Nav.Item>
                  <Button style={{marginLeft: marginLeft, marginRight: marginRight, border: this.state.border, backgroundColor: '#F'}}>Sign Up</Button>
                </Nav.Item>
              </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
  }
}

export default Navigation;
